251→    meshRef.current.rotation.y = t * 0.08;
252→    meshRef.current.rotation.z = Math.sin(t * 0.2) * 0.03;
253→  });
254→
255→  return (
256→    <mesh
257→      ref={meshRef}
258→      position={[2.8, -2.0, 2.2]}
