## Summary: Apollo 3D Scene Patterns & Auth Architecture

Based on my thorough exploration of the codebase, here's a complete reference guide for 3D scene patterns and auth styling:

### 1. **MeshTransmissionMaterial Configuration**

The hero scene uses this glass effect pattern consistently:

```typescript
<MeshTransmissionMaterial
  transmissionSampler
  transmission={1}                    // Full transmission (varies per use: 0.85-1)
  thickness={radius * 5}              // Material depth (scales with geometry)
  roughness={0.01}                    // Near-glass smoothness (0.01-0.05)
  chromaticAberration={0.04}          // RGB channel split (0.01-0.04)
  anisotropicBlur={0.08}              // Directional blur (0.04-0.08)
  distortion={0.15}                   // Wave distortion (0.1-0.15)
  distortionScale={0.4}               // Distortion frequency (0.3-0.4)
  temporalDistortion={0.02}           // Time-based variation (0.01-0.02)
  backside                             // Render backfaces
  backsideThickness={radius * 2}      // Back surface depth
  color={color}                        // Tint color (e.g., "#E8EDE4")
  toneMapped={false}                   // Disable tone mapping for precision
  opacity={0.65-0.85}                 // Alpha blend (0.65 for scatter, 0.85+ for large)
  transparent                          // Enable alpha
/>
```

**Key insight**: Thickness scales with geometry size for realistic refraction. Roughness stays ultra-low for glass authenticity.

---

### 2. **Canvas & Renderer Configuration**

```typescript
<Canvas
  shadows                               // Enable shadow mapping
  camera={{
    position: [0, 0.5, 7],            // Camera placement (hero uses [0, 0.5, 7])
    fov: 38,                           // Field of view (38-40 degrees)
    near: 0.1,                         // Near clipping plane
    far: 50,                           // Far clipping plane
  }}
  dpr={[1, 1.5]}                       // Device pixel ratio (1x mobile, 1.5x desktop)
  gl={{
    antialias: true,
    alpha: true,                       // Transparent background
    powerPreference: "default",
    // Auth scene adds:
    toneMapping: THREE.ACESFilmicToneMapping,  // Film-like tone curve
    toneMappingExposure: 1.1,                  // Exposure boost
  }}
  style={{ background: "transparent" }}
/>
```

**Note**: Auth scene uses ACESFilmicToneMapping + exposure for warmer, more cinematic lighting.

---

### 3. **Lighting Rig**

#### **Hero Scene (Scientific theme)**
```typescript
