<directionalLight
  position={[4, 8, 3]}                // Key light from upper-right
  intensity={1.8}                     // Strong main light
  castShadow
  shadow-mapSize-width={1024}
  shadow-mapSize-height={1024}
  shadow-camera-near={0.5}
  shadow-camera-far={20}
  shadow-camera-left={-6}
  shadow-camera-right={6}
  shadow-camera-top={6}
  shadow-camera-bottom={-6}
  shadow-bias={-0.0005}
/>

<pointLight position={[-4, 4, 3]} intensity={0.6} color="#FFF5E6" />
<pointLight position={[2, -2, 5]} intensity={0.3} color="#F5F0E8" />
<directionalLight position={[-3, 2, -4]} intensity={0.8} color="#E8ECF0" />
```

#### **Auth Scene (Warm, cinematic)**
```typescript
<ambientLight intensity={0.35} />     // Lower ambient for contrast

<directionalLight
  position={[-6, 8, 5]}               // Key from upper-left (opposite of hero)
  intensity={1.6}
  color="#FFF8F0"                     // Warm white
  castShadow
  shadow-mapSize-width={2048}         // Doubled for quality
  shadow-mapSize-height={2048}
  shadow-camera-near={0.5}
  shadow-camera-far={25}
  shadow-camera-left={-8}
  shadow-camera-right={8}
  shadow-camera-top={8}
  shadow-camera-bottom={-8}
