/>

<directionalLight position={[5, 3, 3]} intensity={0.6} color="#E8ECF0" />
<pointLight position={[-3, 4, -5]} intensity={0.8} color="#FFF5E6" distance={20} decay={2} />
<pointLight position={[0, -3, 4]} intensity={0.25} color="#F5EDE0" distance={15} decay={2} />
```

**Pattern**: Warm key light + cool fill + backlit rim lights for depth. Auth uses lower ambient (0.35 vs 0.5) for more dramatic shadows.

---

### 4. **StudioEnvironment (Procedural HDR)**

Both scenes use the same pattern (no external downloads):

```typescript
<Environment frames={1} resolution={128} background={false}>
  {/* Warm key from above */}
  <mesh position={[0, 8, 0]} scale={30}>
    <planeGeometry />
    <meshBasicMaterial color="#FFFEF8" />
  </mesh>

  {/* Bounce from below — warmer in auth */}
  <mesh position={[0, -6, 0]} scale={30} rotation={[Math.PI, 0, 0]}>
    <planeGeometry />
    {/* Hero: #E8E0D0 | Auth: #F0EBE0 */}
    <meshBasicMaterial color="#E8E0D0" />
  </mesh>

  {/* Warm fill from left */}
  <mesh position={[-8, 0, 0]} scale={20} rotation={[0, Math.PI / 2, 0]}>
    <planeGeometry />
    <meshBasicMaterial color="#FFF5E8" />
  </mesh>

  {/* Cool fill from right */}
  <mesh position={[8, 0, 0]} scale={20} rotation={[0, -Math.PI / 2, 0]}>
    <planeGeometry />
    <meshBasicMaterial color="#E8ECF0" />
  </mesh>

  {/* Neutral backlight */}
  <mesh position={[0, 2, 8]} scale={15} rotation={[0, Math.PI, 0]}>
    <planeGeometry />
    <meshBasicMaterial color="#FFFFFF" />
  </mesh>
</Environment>
```

**Key difference**: Auth scene positions back plane at `[0, 3, 8]` instead of `[0, 2, 8]` for higher bounce.

---

### 5. **ContactShadows Configuration**

```typescript
