  position={[0, -1.5, 0]}             // Hero: -1.5 | Auth: -2.45
  opacity={0.3}                        // Soft, subtle (0.3-0.35)
  scale={20}                           // Hero: 20 | Auth: 22
  blur={2.5}                           // Soft feathering
