  far={5}                              // Hero: 5 | Auth: 6 (extends ground influence)
  resolution={512}                     // Medium quality
  color="#2A2520"                      // Dark brown shadow tone
/>
```

---

### 6. **Float/StaticGroup Wrapper Pattern**

Used for reduced-motion accessibility:

```typescript
function FloatWrapper({
  children,
  speed,           // 0.4-1.1 (slower = lazier float)
  floatIntensity,  // 0.06-0.15 (vertical wobble range)
  rotationIntensity, // 0.008-0.03 (spin amount)
}: { children: React.ReactNode; speed: number; floatIntensity: number; rotationIntensity: number }) {
  return (
    <Float speed={speed} floatIntensity={floatIntensity} rotationIntensity={rotationIntensity}>
      {children}
    </Float>
  );
}

function StaticGroup({ children }) {
  return <group>{children}</group>;
}

// Usage:
const Wrapper = reducedMotion ? StaticGroup : FloatWrapper;
<Wrapper speed={0.6} floatIntensity={0.08} rotationIntensity={0.01}>
  {/* Content */}
</Wrapper>
```

---

### 7. **Canvas Texture Creation Pattern**

```typescript
function createPageTexture(variant: 0 | 1 | 2): THREE.CanvasTexture {
  const w = 1024;
  const h = 1440;
  const canvas = document.createElement("canvas");
  canvas.width = w;
  canvas.height = h;
  const ctx = canvas.getContext("2d")!;

  // White background
  ctx.fillStyle = "#FEFEFE";
  ctx.fillRect(0, 0, w, h);

  // Subtle grain (procedural, not image)
  for (let i = 0; i < 800; i++) {
    const gx = Math.floor(((i * 7919 + 104729) % 100003) / 100003 * w);
    const gy = Math.floor(((i * 6271 + 73856) % 100003) / 100003 * h);
    ctx.fillStyle = `rgba(0,0,0,${0.008 + (i % 3) * 0.004})`;
    ctx.fillRect(gx, gy, 2, 2);
  }

  // Typography rendering...
  ctx.font = "bold 42px Georgia, 'Times New Roman', serif";
  ctx.fillText(content.title, margin, 120);

  // Finalize
  const texture = new THREE.CanvasTexture(canvas);
  texture.minFilter = THREE.LinearFilter;
  texture.magFilter = THREE.LinearFilter;
  texture.colorSpace = THREE.SRGBColorSpace;
  return texture;
}

// Cleanup in useEffect:
useEffect(() => {
  return () => { texture.dispose(); };
}, [texture]);
```

**Critical**: Always dispose textures in cleanup to prevent memory leaks. Use `useMemo` to avoid recreating unnecessarily.

---

### 8. **Reduced Motion Hook**

```typescript
function useReducedMotion() {
  const [reduced, setReduced] = useState(false);

  useEffect(() => {
    const mq = window.matchMedia("(prefers-reduced-motion: reduce)");
    setReduced(mq.matches);
    const handler = (e: MediaQueryListEvent) => setReduced(e.matches);
    mq.addEventListener("change", handler);
    return () => mq.removeEventListener("change", handler);
  }, []);

  return reduced;
}
```

Used to disable animations for accessibility while keeping static visuals.

---

